package com.droidlogic.launcher.app;import java.util.ArrayList;import java.util.List;public class AppMoreModel implements IAppInfo {    private final List<AppModel> appModelList = new ArrayList<>();    public List<AppModel> getAppModelList() {        return appModelList;    }    public void addAppModel(AppModel appModel) {        if (appModel != null) {            appModelList.add(appModel);        }    }    @Override    public String toString() {        return "AppMoreModel{" +                "appModelList=" + appModelList +                '}';    }}